import React from 'react'

const ShowData = ({data}) => {
  const render = data.map((d, index) => {
      const completedCheck = d.completed===false ? 'not finished' : 'done'
      return (
          <div>
              <h3>{d.title}</h3>
              <p>No: {d.id}</p>
              <p>{completedCheck}</p>
          </div>
      )
  })
  return render;
}

export default ShowData
